import React from "react";

const Login = () => {
  return (
    <section>
      <div>Logo</div>
      <div style={{ backgroundColor: "yellow", height: "1.4rem" }}>
        Login page
      </div>
      <table>
        <thead>
          <td>Login Username</td>
          <td>
            <input type="text" />
          </td>
        </thead>
        <tbody>
          <td>password</td>
          <td>
            <input type="password" />
          </td>
        </tbody>
      </table>
      <button
        style={{
          width: "200px",
          height: "20px",
          backgroundColor: "lightgreen",
          padding: "5px",
        }}
      >
        Login
      </button>
    </section>
  );
};
export default Login;
